import React from "react";
import { Row } from "antd";
import UserLayout from "./userlayout";
import { Card, Input, Button } from "antd";
const { Search } = Input;
import { SearchOutlined } from "@ant-design/icons";

export default function Overview() {
  return (
    <div>
      <UserLayout>
        <Row style={{ flexDirection: "column", alignItems: "center" }}>
          <h2>Overview</h2>
          <Row style={{ width: "608px", justifyContent: "space-between" }}>
            {" "}
            <div className="site-card-border-less-wrapper">
              <Card style={{ borderLeft: "3px solid #74cf4e", height: "84px" }}>
                <h3>Total Transaction</h3>
                <p>15</p>
              </Card>
            </div>
            <div className="site-card-border-less-wrapper">
              <Card style={{ borderLeft: "3px solid #74cf4e", height: "84px" }}>
                <h3>Total Transaction</h3>
                <p>15</p>
              </Card>
            </div>
            <div className="site-card-border-less-wrapper">
              <Card style={{ borderLeft: "3px solid #74cf4e", height: "84px" }}>
                <h3>Total Transaction</h3>
                <p>15</p>
              </Card>
            </div>
          </Row>
          <Row style={{ marginTop: "75px" }}>
            <div className="site-card-border-less-wrapper">
              <Card style={{ borderLeft: "3px solid #74cf4e" }}>
                <h3>All deliveries</h3>
                <Row style={{ flexDirection: "row", width: "600px" }}>
                  <Input
                    shape="round"
                    style={{ width: "250px",borderR }}
                    placeholder="input search text"
                    //   enterButton="Search"
                    size="large"
                    //  onSearch={(value) => console.log(value)}
                  />
                  <Button
                    type="primary"
                    shape="round"
                    style={{
                      marginLeft: "46px",
                      backgroundColor: "#74cf4e",
                      color: "white",
                    }}
                    icon={<SearchOutlined />}
                  >
                    Search
                  </Button>
                  {/* <Button
                    //   type="primary"
                    enterButton="Search"
                    shape="round"
                    //   icon={<DownloadOutlined />}
                    size="large"
                    style={{
                      marginLeft: "46px",
                      backgroundColor: "#74cf4e",
                      color: "#74cf4e",
                    }}
                  >
                    Search
                  </Button> */}
                </Row>
              </Card>
            </div>
          </Row>
        </Row>
      </UserLayout>
    </div>
  );
}
